import React from 'react';
import { NavLink } from 'react-router-dom';

function Navbar() {
  return (
    <div>
        <div className='navbar'>
      <NavLink exact to="/"
      style={{color:"lightblue",padding:"10px",margin:"auto",}}
      activeStyle={{color:"brown"}}>
        Login
      </NavLink>
      <NavLink to="/about"
      style={{color:"purple",padding:"10px",margin:"auto",}}
      activeStyle={{color:"brown"}}>
        About us
      </NavLink>
      <NavLink to="/parks"
      style={{color:"purple",padding:"10px",margin:"auto",}}
      activeStyle={{color:"brown"}}>
        Parks
      </NavLink>
      <NavLink to="/hotels"
      style={{color:"purple",padding:"10px",margin:"auto",}}
      activeStyle={{color:"brown"}}>
        Hotels
      </NavLink>
      <NavLink to="/orders"
      style={{color:"purple",padding:"10px",margin:"auto",}}
      activeStyle={{color:"brown"}}>
        Orders
      </NavLink>
    </div>
    </div>
  )
}
export default Navbar
